    />

    <meta name="viewport" content="width=device-width, initial-scale=1" />

    <style>
      html:not([data-theme='dark']) {
        --bg: #fff;
        --fg-on: #000;
        --fg: #222;
        --pre-dim: #777;
        --pre-val: #870;
        --pre: #222;
        --bar-min-width: 1px;
      }
      html[data-theme='dark'] {
        color-scheme: dark;
        --bg: #191919;
        --fg-on: #ddd;
        --fg: #aaa;
        --pre-dim: #999;
        --pre-val: #cb8;
        --pre: #ccc;
        --bar-min-width: 3px;
      }
      @media (prefers-color-scheme: dark) {
        html:not([data-theme='light']) {
          color-scheme: dark;
          --bg: #191919;
          --fg-on: #ddd;
          --fg: #aaa;
          --pre-dim: #999;
          --pre-val: #cb8;
          --pre: #ccc;
          --bar-min-width: 3px;
        }
      }
      body {
        margin: 50px;
        font: 16px/20px sans-serif;
        background: var(--bg);
        color: var(--fg);
      }
      #startPanel {
        margin: 10% auto 0;
      }
      #resultsPanel {
        display: none;
      }
      section {
        margin: auto;
        max-width: 600px;
      }
      #logo {
        background-image: url(https://esbuild.github.io/favicon.svg);
        background-size: 80px;
        background-repeat: no-repeat;
        padding-left: 100px;
        display: inline-block;
        text-align: left;
        margin-bottom: 10px;
      }
      h1 {
        font-size: 80px;
        line-height: 1em;
        color: var(--fg-on);
        margin: 0;
      }
      blockquote {
        font-size: 29px;
        line-height: 1em;
        margin: 5px 0;
        font-style: italic;
      }
      p {
        margin: 30px 0;
      }
      a,
      b {
        color: var(--fg-on);
      }
      code {
        font: 14px/20px Noto Sans Mono, monospace;
        background: rgba(127, 127, 127, 0.2);
        padding: 2px 4px;
        margin-bottom: -2px;
        border-radius: 3px;
      }
      pre {
        color: var(--pre);
        font: 14px/20px Noto Sans Mono, monospace;
        padding: 0;
        margin: 0;
        white-space: pre-wrap;
      }
      .center {
        text-align: center;
      }
      .noscript {
        color: #e24834;
      }
      button {
        padding: 5px 30px;
        line-height: 1.5em;
        background: none;
        color: var(--fg);
        border: 1px solid var(--fg);
        border-radius: 100px;
        cursor: pointer;
      }
      button:active,
      button:hover {
        color: var(--fg-on);
        border: 1px solid var(--fg-on);
        background: rgba(127, 127, 127, 0.2);
      }
      button:active {
        padding: 6px 30px 4px;
        background: rgba(0, 0, 0, 0.2);
      }
      #settingsPanel {
        text-align: center;
      }
      #settingsPanel .chartSwitcher {
        position: relative;
        margin: 50px 0;
        display: flex;
        justify-content: center;
      }
      #settingsPanel .chartSwitcher:after {
        position: absolute;
        left: 0;
        right: 0;
        top: 0.5em;
        content: '';
        display: block;
        border: 1px solid #ffcf00;
        z-index: -1;
      }
      #settingsPanel .chartSwitcher span {
        background: var(--bg);
        padding: 0 1em;
        border-left: 2px solid #ffcf00;
      }
      #settingsPanel .chartSwitcher span:first-child {
        border: none;
      }
      #settingsPanel a {
        text-decoration: none;
        color: var(--fg);
      }
      #settingsPanel a:hover {
        text-decoration: underline;
      }
      #settingsPanel a.active {
        font-weight: 700;
        color: var(--fg-on);
      }
      .summary {
        max-width: 600px;
        margin: auto;
      }
      .tooltip {
        position: absolute;
        background: black;
        color: #999;
        border-radius: 30px;
        padding: 0 10px;
        font-size: 14px;
        line-height: 30px;
        display: none;
        user-select: none;
        touch-action: none;
        pointer-events: none;
        z-index: 1;
        white-space: pre;
      }
      .tooltip b {
        color: #fff;
      }
      #dragTarget {
        display: none;
        position: fixed;
        left: 0;
        top: 0;
        right: 0;
        bottom: 0;
        user-select: none;
        touch-action: none;
        box-shadow: inset 0 0 0 10px #ffcf00;
        z-index: 10;
      }
      #summaryPanel {
        text-align: center;
      }
      #summaryPanel table {
        border-collapse: collapse;
        margin: auto;
      }
      #summaryPanel td:first-child {
        text-align: right;
      }
      #summaryPanel h2 {
        font-size: 30px;
        line-height: 1em;
        color: var(--fg-on);
        margin: 0;
      }
      #summaryPanel .symbol {
        font-size: 30px;
        padding: 0 30px;
      }
      #summaryPanel .formatBreakdown {
        display: inline-block;
        margin: 20px auto 0;
        white-space: nowrap;
        text-decoration: none;
      }
      #summaryPanel .formatBreakdown:hover .side {
        text-decoration: underline;
      }
      #summaryPanel .bar {
        display: inline-table;
        vertical-align: middle;
        margin: 0 0.8em;
        border: 1px solid #222;
      }
      #summaryPanel .bar > div {
        height: 20px;
        display: table-cell;
      }
      #colorLegend {
        padding-left: 1.6em;
        line-height: 1.1em;
      }
      #colorLegend .chit {
        display: inline-block;
        vertical-align: middle;
        width: 1.1em;
        height: 1.1em;
        margin-left: -1.6em;
        margin-right: 0.5em;
        border: 1px solid #222;
        box-sizing: border-box;
      }
      #colorLegend small {
        display: block;
        opacity: 0.5;
        margin-bottom: 1em;
      }
      #sunburstPanel main {
        display: flex;
        justify-content: center;
        margin-top: 50px;
        margin-bottom: 500px;
      }
      #sunburstPanel .left {
        margin-right: 20px;
        display: flex;
        flex-direction: column;
        align-items: center;
      }
      #sunburstPanel canvas {
        display: block;
        margin-bottom: 30px;
      }
      #sunburstPanel .details {
        flex: 1;
        max-width: 800px;
        position: relative;
      }
      #sunburstPanel .dir {
        font-size: 20px;
        line-height: 1.2em;
        display: flex;
        white-space: pre;
        margin: 0 10px 20px;
      }
      #sunburstPanel .dir .segments {
        flex: 1;
        height: 20px;
      }
      #sunburstPanel .dir a {
        opacity: 0.5;
        text-decoration: none;
      }
      #sunburstPanel .dir a[href]:hover {
        text-decoration: underline;
      }
      #sunburstPanel .dir a:last-child {
        opacity: 1;
        color: var(--fg-on);
        font-weight: 700;
      }
      #sunburstPanel .bars {
        width: 100%;
      }
      #sunburstPanel .bars .row {
        display: table-row;
        text-decoration: none;
        line-height: 26px;
        color: var(--fg);
      }
      #sunburstPanel .bars .row.hover {
        background: rgba(127, 127, 127, 0.2);
        color: var(--fg-on);
      }
      #sunburstPanel .bars .row.hover .bar:after {
        content: '';
        position: absolute;
        left: 1px;
        top: 1px;
        right: 1px;
        bottom: 1px;
        background: rgba(255, 255, 255, 0.3);
      }
      #sunburstPanel .bars .row > div {
        display: table-cell;
      }
      #sunburstPanel .bars .name {
        padding: 0 10px;
        vertical-align: top;
        white-space: pre;
      }
      #sunburstPanel .bars .name span {
        opacity: 0.5;
      }
      #sunburstPanel .bars .size {
        width: 100%;
        padding-right: 100px;
      }
      #sunburstPanel .bars .bar {
        position: relative;
        height: 27px;
        box-shadow: inset 0 0 0 1px #222;
        margin-bottom: -1px;
        min-width: var(--bar-min-width);
      }
      #sunburstPanel .bars .bar.empty {
        min-width: 0;
      }
      #sunburstPanel .bars .last {
        position: absolute;
        right: -10px;
        width: 0;
        white-space: nowrap;
      }
      #whyFile {
        position: fixed;
        left: 0;
        top: 0;
        right: 0;
        bottom: 0;
        padding: 50px;
        background: rgba(0, 0, 0, 0.6);
        overflow-y: auto;
      }
      #whyFile .dialog {
        position: relative;
        margin: 0 auto;
        padding: 50px;
        max-width: 1000px;
        background: var(--bg);
        box-shadow: 0 10px 20px rgba(0, 0, 0, 0.6);
        box-sizing: border-box;
        border-radius: 20px;
      }
      #whyFile .dialog:focus {
        outline: none;
      }
      #whyFile .closeButton {
        position: absolute;
        right: 0;
        top: 0;
        width: 50px;
        text-decoration: none;
        font-size: 30px;
        line-height: 50px;
        text-align: center;
        color: var(--fg);
      }
      #whyFile .closeButton:hover {
        font-size: 35px;
        color: var(--fg-on);
      }
      #whyFile .closeButton:active {
        font-size: 30px;
      }
      #whyFile h2 {
        border-bottom: 2px solid #ffcf00;
        padding-bottom: 4px;
        margin: 0;
        font-size: 20px;
        line-height: 1.2em;
        color: var(--fg-on);
      }
      #whyFile .outputFile {
        position: relative;
        border: 1px solid rgba(127, 127, 127, 0.5);
        padding: 30px 10px 10px;
        border-radius: 10px;
        white-space: pre-wrap;
        margin-top: 10px;
        line-height: 22px;
      }
      #whyFile .outputPath {
        position: absolute;
        left: 0;
        top: 0;
        background: rgba(127, 127, 127, 0.1);
        border-right: 1px solid rgba(127, 127, 127, 0.5);
        border-bottom: 1px solid rgba(127, 127, 127, 0.5);
        border-top-left-radius: 10px;
        border-bottom-right-radius: 10px;
        padding: 5px 10px;
      }
      #whyFile pre {
        padding: 0 0 0 30px;
      }
      #whyFile .comment {
        color: var(--pre-dim);
      }
      #whyFile .keyword {
        color: var(--fg-on);
      }
      #whyFile .string {
        color: var(--pre-val);
      }
      #whyFile .arrow,
      #whyFile .longArrow {
        position: relative;
      }
      #whyFile .arrow:after,
      #whyFile .longArrow:after {
        content: '';
        position: absolute;
        top: 0;
        width: 30px;
        background: var(--fg);
        opacity: 0.5;
      }
      #whyFile .arrow:after {
        height: 40px;
        --icon: url('data:image/svg+xml,<svg width="30" height="40" xmlns="http://www.w3.org/2000/svg"><path d="M16.5 26L20.5 35L23 25.5L16.5 26Z"/><path d="M5 7C15 7 19 15 20 30" fill="none" stroke="black"/></svg>');
        mask-image: var(--icon);
        -webkit-mask-image: var(--icon);
      }
      #whyFile .longArrow:after {
        height: 90px;
        --icon: url('data:image/svg+xml,<svg width="30" height="90" xmlns="http://www.w3.org/2000/svg"><path d="M17 76L20 85L23 76H17Z"/><path d="M5 7C15 7 20 25 20 80" fill="none" stroke="black"/></svg>');
        mask-image: var(--icon);
        -webkit-mask-image: var(--icon);
      }
      #flamePanel main {
        position: relative;
        margin-top: 60px;
      }
      #flamePanel canvas {
        position: absolute;
        left: -50px;
        top: 0;
      }
      #flamePanel section {
        margin-top: 30px;
        min-height: 500px;
      }
      #warningsPanel {
        max-width: 1000px;
        margin: auto;
      }
      #warningsPanel .expand {
        margin-top: 20px;
        text-align: center;
      }
      #warningsPanel .content {
        display: none;
      }
      #warningsPanel .warning {
        margin: 30px 0;
        white-space: pre-wrap;
        color: var(--fg-on);
      }
      #warningsPanel ul {
        color: var(--fg);
        margin: 5px 0 0;
      }
      #warningsPanel .dim {
        opacity: 0.5;
      }
      #warningsPanel pre a {
        text-decoration: none;
      }
      #warningsPanel pre a:hover {
        text-decoration: underline;
      }
    </style>
  </head>
